('ana cristina 38', 'AnaCristinaOnlineTelenovelaAnaCristinaVerAnaCristina', 'Ana Cristina Online Telenovela Ana Cristina Ver Ana Cristina', '2011', 'tv, telenovela, tvnovela, atv, dialymotion', 'Soledad Pino, una humilde campesina, queda embarazada de Anselmo Benavides; pero él desconoce de esto y se casa con Victoria Aragón, heredera de una gran empresa hotelera. Soledad se convierte en madre soltera y da a luz a Ana Cristina, quien es criada por su tía Rosa, la hermana mayor de Soledad, ya que ella decide viajar a Estados Unidos para trabajar. Anselmo y Victoria tienen dos hijas: Jimena y Maria Julia \"Maju\". Victoria y su madre, Regina, planean asesinar a Soledad y a su hija para que deje ser un estorbo en su matrimonio. Una noche, Rosa junto a su comadre y el bebé de ella escuchan las noticias y se enteran que Soledad Pino \"murió\" en la frontera; luego, repentinamente, incendian la casita en donde estaban. Rosa logra salvar a la pequeña bebé Ana, pero su comadre y el bebé de ésta mueren. Victoria y su madre gozan al creer que tanto Soledad como Ana están muertas, mientras Anselmo siente mucha tristeza al recordar a Soledad.', 'http://vertelenovelas.net/image_files/ana-cristina.jpg', ' <iframe src="http://www.dailymotion.com/embed/video/xjihhy?theme=harris&foreground=%23FFFFFF&highlight=%23C9A1FF&background=%23FB63B9" width="807" height="360" frameborder="0"></iframe> <iframe src="http://www.dailymotion.com/embed/video/xjiho3?theme=harris&foreground=%23FFFFFF&highlight=%23C9A1FF&background=%23FB63B9" width="807" height="360" frameborder="0"></iframe> <iframe src="http://www.dailymotion.com/embed/video/xjihwg?theme=harris&foreground=%23FFFFFF&highlight=%23C9A1FF&background=%23FB63B9" width="807" height="360" frameborder="0"></iframe> <iframe src="http://www.dailymotion.com/embed/video/xjii60?theme=harris&foreground=%23FFFFFF&highlight=%23C9A1FF&background=%23FB63B9" width="807" height="360" frameborder="0"></iframe> <iframe src="http://www.dailymotion.com/embe